// src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import TopNav from './components/TopNav';
import Analytics from './components/Analytics';
import UserProfile from './components/UserProfile';
import TrendFusionAI from './components/TrendFusionAI';
import OAuthCallback from './components/OAuthCallback';
import LandingPage from './components/LandingPage';
import Posts from './components/Posts';
import Comments from './components/Comments';
import Feedback from './components/Feedback';
import OpenAITest from './components/OpenAITest';
import './styles/Common.css';

function App() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const fetchUserData = async () => {
      const userData = await getUserData();
      setUser(userData);
    };

    fetchUserData();
  }, []);

  const getUserData = async () => {
    // Simulate fetching user data with a delay
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve({
          avatarUrl: 'https://example.com/user-avatar.jpg',
          username: 'tjy2460',
          followingCount: 236,
          followerCount: 36,
          likesCount: 0,
          onGeneratePersonaAnalysis: () => {
            console.log('Generate Persona Analysis');
          },
        });
      }, 1000); // Simulated delay
    });
  };

  return (
    <Router>
      <div className="app">
        <TopNav />
        <div className="main-layout">
          <Sidebar />
          <div className="content-container">
            <Routes>
              <Route path="/" element={<LandingPage />} exact />
              <Route path="/home" element={<LandingPage />} exact />
              <Route path="/user-profile" element={<UserProfile user={user} />} />
              <Route path="/analytics" element={<Analytics />} />
              <Route path="/trend-fusion-ai" element={<TrendFusionAI />} />
              <Route path="/oauth/callback" element={<OAuthCallback />} />
              <Route path="/posts" element={<Posts />} />
              <Route path="/comments" element={<Comments />} />
              <Route path="/feedback" element={<Feedback />} />
              <Route path="/openai-test" element={<OpenAITest />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
